export const Background2: React.FC<IconSvgProps> = (props): JSX.Element => {
  const { color } = props;
  const numStars = 50; // Nombre d'étoiles à générer
  const starSize = 3; // Taille des étoiles

  // Fonction pour générer les points d'une étoile à cinq branches
  const createStarPoints = (size: number) => {
    const points = [];
    const angle = (Math.PI * 2) / 5;

    for (let i = 0; i < 5; i++) {
      const outerX = size * Math.cos(i * angle);
      const outerY = size * Math.sin(i * angle);
      const innerX = (size / 2) * Math.cos(i * angle + angle / 2);
      const innerY = (size / 2) * Math.sin(i * angle + angle / 2);

      points.push(`${outerX},${outerY}`);
      points.push(`${innerX},${innerY}`);
    }

    return points.join(' ');
  };

  // Fonction pour générer des positions aléatoires pour les étoiles
  const generateStars = () => {
    const stars = [];

    for (let i = 0; i < numStars; i++) {
      const x = Math.random() * 100; // Position aléatoire en pourcentage sur l'axe x
      const y = Math.random() * 100; // Position aléatoire en pourcentage sur l'axe y

      stars.push(
        <polygon
          key={i}
          fill={color}
          points={createStarPoints(starSize)}
          transform={`translate(${x}, ${y})`}
        />
      );
    }

    return stars;
  };

  return (
    <svg
      style={{ width: "100%", height: "100%" }}
      viewBox="-10 -10 120 120"
      xmlns="http://www.w3.org/2000/svg"
    >
      {generateStars()}
    </svg>
  );
};

